<?php

namespace App\Http\Controllers\Api;

use Illuminate\Http\Request;
use App\Http\Controllers\Controller;
use Illuminate\Support\Facades\Auth;
use Illuminate\Support\Facades\Storage;
use App\User;

class UserController extends Controller {

	public function store( Request $request ) {

		$user = User::find( $request['id'] );

		$user->update( $request->except( 'photo' ) );

		return [ 'status' => 'success', 'message' => 'Saved', 'data' => $user ];
	}


	public function uploadUserAvatar( Request $request, $id ) {

		if ( $request->input( 'avatar' ) ) {

//			$base64 = 'data:image/png;base64,';

			$base64 = $request->input( 'avatar' );

			$user = User::find( $id );

			$imageName = $user->name . ' avatar.png';

			$user->avatar()->updateOrCreate( [ 'avatar_id' => $user->id ], [
				'name'    => $imageName,
				'user_id' => $user->id,
				'folder'  => '/user',
				'url'     => null
			] );

			list( $baseType, $image ) = explode( ';', $base64 );
			list( , $image ) = explode( ',', $image );
			$image = base64_decode( $image );
			Storage::put( 'public/user/' . $user->id . '/' . $imageName, $image, 'public' );

			return [ 'status' => 'success', 'message' => 'Saved', 'data' => $user->avatar ];
		}
	}

	public function uploadUserImage( Request $request, $id ) {

		if ( $request->file( 'file' ) ) {

			$user = User::find( $id );

			$user->image()->updateOrCreate( [ 'image_id' => $user->id ], [
				'name'    => $request->file( 'file' )->getClientOriginalName(),
				'user_id' => $user->id,
				'folder'  => '/user/image',
				'url'     => null
			] );

			$request->file( 'file' )->storeAs( '/public/user/image/' . $id, $request->file( 'file' )->getClientOriginalName() );

			return [ 'status' => 'success', 'message' => 'Saved', 'data' => $user->image ];
		}
	}
}
